def findName(mail):
    mail = str(mail)
    name = ''
    for c in mail:
        if c not in string.digits:
            name = name + c
        else:
            break
    return name

def makeUsername(name):
    if random.randrange(10)>5:
        for j in range(1, 2):
            name = name + random.choice([".", "_", "-"])
    name = name + str(random.randrange(100, 99999))
    return name

